#### Definitions

**1** Â  In this Act:

**"limited liability entity"**, in relation to a resource road, means each of the following:

(a) the maintainer, if any, of the resource road;

(b) the government;

**"maintainer"**, in relation to a resource road, means the person, including, without limitation, the government, that is obligated or authorized under an enactment to maintain the resource road, but does not include a prescribed person or a person within a prescribed class of persons;

**"motor vehicle"** means a vehicle that is

(a) intended to be self-propelled, and

(b) designed primarily for travel on land on surfaces other than rails;

**"occupier"** means a person who

(a) is in physical possession of premises, or

(b) has responsibility for, and control over, the condition of premises, the activities conducted on those premises and the persons allowed to enter those premises,

and, for this Act, there may be more than one occupier of the same premises;

**"premises"** includes

(a) land and structures or either of them, excepting portable structures and equipment other than those described in paragraph (c),

(b) ships and vessels,

(c) trailers and portable structures designed or used for a residence, business or shelter, and

(d) railway locomotives, railway cars, vehicles and aircraft while not in operation;

**"resource road"** means any road or portion of a road that is

(a) on Crown land, and

(b) used or intended for use by motor vehicles,

but does not include a municipal highway or a provincial public highway as those terms are defined in the [*Transportation Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/04044_01);

**"tenancy"** includes a statutory tenancy, an implied tenancy and any contract conferring the right of occupation, and "landlord" must be construed accordingly.
